<template>
    <md-layout md-align="center" md-gutter="16">
        <div v-if="!invalidAppName" style="position: absolute; margin: auto; width: 95%; top: 50%; text-align: center;">
            <h1>Redirecting to {{ appMethods[appName].displayName }}</h1>
            <img src="data:image/gif;base64,"/>
        </div>
        <div v-else>
            Invalid app name: {{ appName }}
        </div>
    </md-layout>
</template>

<script lang="ts">
    import {AxiosResponse} from 'axios';

    import Vue from 'vue';
    import Component from "vue-class-component";

    import {
        Prop,
    } from "vue-property-decorator";

    import {WebAPI} from "../web-api";
    import {Snackbar} from "../snackbar";

    @Component({
        components: {}
    })
    export default class LoadingExternalPage extends Vue {

        @Prop({type: String})
        public appName: string;

        @Prop({type: String})
        public objectId: string;

        public invalidAppName = false;

        public appMethods: any = {
            'degust': {
                displayName: 'Degust',
                method: this.redirectToDegust
            },
        };

        public async created() {
            const app = this.appMethods[this.appName];
            if (!app) {
                this.invalidAppName = true;
            } else {
                await app.method(this.objectId);
            }
        }

        public async mounted() {

        }

        public async redirectToDegust(fileId: string) {
            const response = await WebAPI.sendToDegust(fileId);
            if (response.data.status == 200) {
                window.location.href = response.data.redirect;
            } else {
                console.log(response);
                console.log(`Failed to send to Degust - backend error ?`);
            }
        }
    }
</script>

